import styled from 'styled-components';

export const SideBarButtonStyled = styled.button`
	width: 80%;
	min-width: 150px;
	font-size: 2rem;
	color: black;
	background-color: blueviolet;
	border: 1px solid transparent;
	margin: 10px;

	&:hover {
		cursor: pointer;
		border: 1px solid white;
	}
`;
